// ==UserScript==
// @name           nyashnyl
// @namespace      http://wakachan.org/unyl/
// @description    maximum kawaii for /unyl/
// @include        http://wakachan.org/*
// @include        http://*.wakachan.org/*
// @author         unylnonymous
// ==/UserScript==

String.prototype.format = function(obj) {
	var formatted = this;
	for (var i in obj) {
		var regexp = new RegExp('\\$' + i, 'gi');
		formatted = formatted.replace(regexp, obj[i]);
	}
	return formatted;
};

// http://code.google.com/p/chromium/issues/detail?id=153720
var kyukurri_data = '';

var common_css = ' .thumb { display: block; box-shadow: 0px 0px 20px #000; margin-bottom: 1em; border-radius: 3px; }'
	+ ' .filesize { display:none !important; }'
	+ ' .reply { border-radius: 5px !important; }'
	+ ' blockquote + table, blockquote + span + table { clear: both; }'
	+ ' hr { border: 1px dotted #000000; }'
	+ ' .injected { display: inline-block; }'
	;

var mainpage_css = common_css 
	+ ' form#delform { -webkit-column-count: $cc; -moz-column-count: $cc; column-count: $cc; background: url(data:image/png;base64,' + (kyukurri_data) + ') no-repeat bottom; }'
	+ ' .last { width: 100%; }'
	;

var thread_css = common_css
	+ ' form#delform { width: $squeeze_factor%; margin-left: auto; margin-right: auto; }'
	;

function thread_url() {
	return (window.location.href.match(/\/res\//) ? true : false);
}

function column_count(window_width) {
	if (window_width < 1200) return 1;
	if (window_width < 2400) return 2;
	if (window_width < 3600) return 3;
	return 10; // fuck you
}

function squeeze_factor(window_width) {
	var columns = column_count(window_width);
	return 100 / columns;
}

function redo_page() { 
	var superdiv = document.createElement('div');
	var delform = document.getElementById("delform");
	
	var sib = delform.firstChild;
	
	if (!sib) {
		return;
	}
	
	while (1) {
		var div = document.createElement('div');
		div.setAttribute('class', 'injected');

		delform.insertBefore(div, sib);

		while (sib) {
			var next = sib.nextSibling;
			var tag = sib.tagName;

			div.appendChild(sib);
			sib = next;

			if (tag == 'HR') {
				break;
			}
		}

		if (!sib) {
			div.setAttribute('class', 'injected last');
			break;
		}
	}
};

function instrument_css() {
	var css = (thread_url() ? thread_css : mainpage_css);
	css = css.format({
		'cc': thread_url() ? 1 : column_count(window.innerWidth), 
		'squeeze_factor': squeeze_factor(window.innerWidth),
	});

	var style = document.createElement('style');
	style.type = 'text/css';
	style.appendChild(document.createTextNode(css));

	document.getElementsByTagName('head')[0].appendChild(style);
}

function boom() {
	if (!thread_url()) {
		redo_page();
	}

	instrument_css();
}

(function() {

	boom();

})();

